import './App.css';
import { useState, useEffect } from "react";

function App() {

  const [registerData,setRegisterData] = useState({user:"",password:""})
  const [loginData,setLoginData] = useState({user:"",password:""})

  function newUser(){
    fetch('http://localhost:3500/register')
    .then(response => response.json())
    .then(data => console.log(data))
  }

  function logIn(){
    fetch('http://localhost:3500/auth')
    .then(response => response.json())
    .then(data => console.log(data))
  }



  return (
    <div className="App">
      <div className='signUp'>
        <input type="text" name="Ruser" value={registerData.user} onChange={e=>setInfo((x)=>({...x, name:e.target.value}))}></input>
        <input type="text" name="Rpwd" value={registerData.password}></input>
        <button onClick={newUser}>register</button>
      </div>

      <div className='login'>
        <input type="text" name="Luser" value={loginData.user}></input>
        <input type="text" name="Lpwd" value={loginData.password}></input>
        <button onClick={logIn}>login</button>

      </div>
    </div>
  );
}

export default App;
